import React,{Component} from 'react';
import './AdminPage.css';
import AdminNavBar from '../../layout/AdminNavbar';
import UserDescription from '../../layout/UserDescription';
import { useState } from 'react';
import axios from "axios";



class AdminPage extends Component {
    state = {
        loaded: false,
        data:{},
        length:0
      };
    
      componentDidMount() {
        console.log('componentDidMount() lifecycle');
        axios.get("http://localhost:5000/api/getAllUsers")
        .then(res => {
            if(res.data.success===true){
            this.setState({ loaded: true,data:res.data.data });
            }else {
            this.setState({ loaded: false,data:"Error in loading data" });
            }
        })


        // Trigger update
      }
    
      render() {

    return (
        <>
        <AdminNavBar />

        {/* Users Section */ }
        
        <div className='UsersSection'>
            <div className="UsersConainer">
                <h1 className='UsersSectionTitle'>Users list</h1>
                { !this.state.loaded ? <p>Error</p> :

                
                <table id="customers">
                <tr>
                    <th>ID</th>
                    <th>EMAIL</th>
                    <th>FIRST NAME</th>
                    <th>LAST NAME</th>
                   
                </tr>

                <UserDescription 
                id={ this.state.data[0]._}
                email={ this.state.data[0].email}
                firstname={ this.state.data[0].firstName}
                lastname={ this.state.data[0].lastName}

                />
                <UserDescription
                 />
                <UserDescription />
                <UserDescription />
                <UserDescription />
                
                </table>
               
                }

                    

            </div>
        </div>
            
        </>
    )
}
}

export default AdminPage
